Bio: I like nature and the planet Earth. There are so many amazing things in this wonderful world. I like traveling and I want to smell different smells. I want to see different kinds of trees, flowers and plants. When I spend a holiday traveling, I always take a camera with me and photograph everything that interests or pleases me: the sights of a city, views of mountains, lakes, valleys and the ruins of ancient buildings.
